import six
import bz2
import base64

from devtools.ya.core.yarg import OptsHandler

DATA = ''


class KrevedkoYaHandler(OptsHandler):
    visible = False

    def __init__(self):
        OptsHandler.__init__(
            self,
            action=do_stuff,
        )


def do_stuff(params):
    print(six.ensure_str(bz2.decompress(base64.b64decode(DATA))))
